window.bookSummaryJSON = "<p><b>Hidden and torn</b> </p> <p>I'd broken out of the half-breed prison but the memories still haunt me. Now I'm living with my biological parents and their pack.</p> <p>To make matters worse, the guard and sexy inmate escaped with me. Each one tugs at my soul and I'm not even sure why.</p> <p>As I tried acclimate to my new life and new powers, I find that I'm more confused than ever.</p> <p>My path was clear before me. I refused to stay hidden and was determined rescue my people no matter what it costs me.</p> <p>If you can't get enough of books by K.F. Breene, Kelly St. Claire, Annette Marie, Shannon Mayer, Leia Stone, Jaymin Eve, and Laura Thalassa, then you'll be sucked into this paranormal romance. </p>"; 
